public class PowerOfThree {

    public static boolean isPowerOfThree(int n) {
        if (n <= 0) { 
            return false;
        }
        if (n == 1) {
            return true;
        }

        // Optimized using log base 3 to check divisibiity
        int floorLog = (int) Math.floor(Math.log(n) / Math.log(3));
        return (n & (n - 1) == 0) && (floorLog % 2 == 0);
    }

    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        System.out.println("Enter an integer:");
        int n = sc.nextInt();

        if (isPowerOfThree(n)) {
